  return (
    <Box
      component="form"
      sx={{
        "& .MuiTextField-root": { m: 1, width: "25ch" },
      }}
      noValidate
      autoComplete="off"
    >
      <div className="container">
        <h2 className="title">
          Ingrese todos los datos para completar el registro:
        </h2>

        <div className="div-input">
          <TextField
            required
            id="name"
            label="Nombre de usuario"
            variant="filled"
            onChange={handleName}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <AccountCircle />
                </InputAdornment>
              ),
            }}
          />
        </div>
        <div className="div-input">
          <TextField
            required
            id="password"
            label="ContraseÃ±a"
            type="password"
            autoComplete="current-password"
            variant="filled"
            onChange={handlePassword}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <PasswordIcon />
                </InputAdornment>
              ),
            }}
          />
        </div>
        <div className="div-input">
          <TextField
            required
            label="Email"
            type="email"
            id="email"
            variant="filled"
            onChange={handleEmail}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <EmailIcon />
                </InputAdornment>
              ),
            }}
          />
        </div>
        <div className="div-input" id="last-div">
          <div>
            <Button
              className="enviar-datos"
              variant="contained"
              onClick={registerHandler}
            >
              Registrarme
            </Button>
          </div>
        </div>
      </div>
    </Box>
  );
};

export default Register;
